import React from "react";
import { BsFillSuitHeartFill} from "react-icons/bs";
import { BsShieldShaded } from "react-icons/bs";
import { BsLightning } from "react-icons/bs";


function Botspecs({name,health,damage,armor,catchphrase,avatar_url}) {

   return(

    <div className="collection">
    <h1>{name}</h1>
    <p><BsFillSuitHeartFill/>{health}</p> 
     <p><BsLightning/>{damage}</p>  
     <p><BsShieldShaded/>{armor}</p>
    <p>{catchphrase}</p>
    <img src={avatar_url} alt="my image"></img>
    </div>


   )
}
export default Botspecs
